import React from 'react';
import { useAuth0 } from '../contexts/auth0-context';
import {Link} from 'react-router-dom';

export default function Header() {
  const { isLoading, user, loginWithRedirect, logout } = useAuth0();

  return (
    <header>
      <nav className="navbar is-dark">
        <div className="container">                      
            <div className="navbar-brand">
              <Link to='/' className='text-white' ><i className='fa fa-home' ></i> MovieApp Test</Link>
            </div>

            <div className="navbar-end">
              {!isLoading && !user && (
                <div>  
                  <button onClick={loginWithRedirect} className="navbar-item">
                    Login
                  </button>
                    <button className="btn bt-ountline-light">{user.name}</button>
                    <button
                      onClick={() => logout({ returnTo: window.location.origin })}
                      className="btn bt-ountline-light"
                    >Logout
                    </button>
                </div>  
              )}
            </div>
        </div>
      </nav>
    </header>
  );
}
